import React from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import axios from 'axios';
import App from './App';

export default function Load(data) { {

  mySubmitHandler = async (event) => {
    event.preventDefault();
    await axios({
      method: 'post',
      url: 'https://www.binance.com/bapi/nft/v1/public/nft/product-list',
      headers: {
        "accept": "*/*",
        "accept-language": "it-IT,it;q=0.9,en-US;q=0.8,en;q=0.7",
        "clienttype": "web",
        "content-type": "application/json",
        "lang": "en"
      },
      data: this.state.body
    })
      .then((response) => {
        this.setState({
          isLoaded: true,
          showComponent: true,
          items: response.data.data.rows,
          numItems: response.data.data.total
        });
      })
      .catch((error) => 
      {
        this.setState({
          isLoaded: true,
          showComponent: true,
          error
        });
      });
      await axios({
        method: 'get',
        url: 'https://api.coingecko.com/api/v3/simple/price?ids=ethereum%2Cbinancecoin&vs_currencies=usd'
      })
        .then((response) => {
          this.setState({
            coins: response,
            coinsLoad: true
          });
        })
        .catch((error) => 
        {
          this.setState({
            error
          });
        });

      console.log(this.state)
  }
  myChangeHandler = (event) => {
    this.setState({
      body: "{\"category\":0,\"keyword\":\"" + event.target.value + "\",\"orderBy\":\"list_time\",\"orderType\":-1,\"page\":1,\"rows\":100}",
      itemName: event.target.value
    });
  }
    return (
      <div>
      {this.state.showComponent ?
      <App data={this.state}/> :
      null
     }
     </div>
    );
  }
}
